# endereco fim do cenario 0x10010000 + 65536

# vetor com paramentros dos personagens 0x10010000 + 69976
# b, h, x inicial, y inicial, x final, y, final, offset endereco direita, offset endereco esquerda
.word 11 7 15 20 100 20 65536 65844 # personagem 1: offset do endereco do vetor 69976
.word 11 7 25 35 60 35 66152 66460 # personagem 2: offset do endereco do vetor 70008
.word 11 7 35 50 70 50 66768 67076 # personagem 3: offset do endereco do vetor 70040
.word 9 12 64 46 100 50 67384 68680 # personagem 4: offset do endereco do vetor 70072
                                                                                                                
.text

# assets: tamanho 1142
	# identificador, b x h, offset a partir do final cenario
	# porta or direita, 11 x 7, 4
	# porta or esquerda, 11 x 7, 312
	# porta and direita, 11 x 7, 620
	# porta and esquerda, 11 x 7, 928
	# porta not direita, 11 x 7, 1236
	# porta not esquerda, 11 x 7, 1544
	# protagonista parado direita, 9 x 12, 1852 
	# protagonista andando direita, 9 x 12, 2284
	# protagonista correndo direita, 9 x 12, 2716     
	# protagonista parado esquerda, 9 x 12, 3148
	# protagonista andando esquerda, 9 x 12, 3580     
	# protagonista correndo esquerda, 9 x 12, 4012
	# vetor com parametros, 8 x 4, 4444


# orientacoes:
# este programa funciona para as seguintes configuracoes graficas:
	
	# Unit Width in Pixels: 4
	# Unit Height in Pixels: 4
	# Display Width in Pixels: 512
	# Display Height in Pixels: 256
	
# copie e cole o mapa de bits do cenario e o mapa dos personagens entre .data e .text
# adicione no vetor de parametros dos personagens:
	# base,
	# altura
	# x inicial, 
	# y inicial,
	# x final,
	# y final,
	# offset do inicio de personagem
# altere como o movimento acontecer na tela modificando o laco da animacao
# configure o controle de personagem conforme desejado:
	# a move o personagem para a direita
	# w move o personagem para cima
	# s mode o personagem para baixo
	# d mode o personagem para esquerda

main: 	

# parametros globais
	
	addi $26 $0 8192 # tamanho da tela
	addi $27 $0 1142 # tamanho dos assets + vetor dso paramentros
	addi $6 $0 512 # width
	addi $7 $0 4 # porporcao width
	
	# chamada de funcao para
	# guardar cenario e
	# personagem na memoria
	add $10, $27, $26 # contador da iteracao
	add $8 $0 $10
	sll $8 $8 2
	addi $8 $8 0x10010000
	addi $8 $8 -4 # local a ser lido
	add $24 $0 $10
	sll $24 $24 2
	add $24 $24 $8 
	sll $1 $27 2
	sub $24 $24 $1 # local a ser armazenado
	jal store
	
	# chamada de funcao para
	# carregar cenario na tela
	lui $8, 0x1001 # local a ser escrito
	add $24 $0 $26
	sll $24 $24 2
	add $24 $24 $8 # local a ser lido
	addi $10, $0, 0 # contador
	jal load
	
	
	lui $2 0x1001
	addi $1 $0 69976 # personagem[0]
	add $2 $2 $1
	
	lui $3 0x1001
	addi $1 $0 70072#70008 # personagem[1]
	add $3 $3 $1
	
	lui $4 0x1001
	addi $1 $0 70040 # personagem[2]
	add $4 $4 $1
	
	lui $5 0x1001
	addi $1 $0 70072 # personagem[3]
	add $5 $5 $1

	
# laco de repeticao para personagem na tela
animacao:
	bne  $0, $0, fimanimacao # comparacao de posicao
	
# carregamento de parametros de personagem

	lw $22 0($2) # base  
	lw $23 4($2) # altura 
	lw $18 8($2) # x inicial
	lw $19 12($2) # y inicial
	lw $20 16($2) # x final
	lw $21 20($2) # y final
	lw $28 24($2) # direita
	lw $29 28($2) # esquerda
	
	# chamada de funcao para
	# carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# carregamento de parametros de personagem
	
	lw $22 0($3) # base  
	lw $23 4($3) # altura 
	lw $18 8($3) # x inicial
	lw $19 12($3) # y inicial
	lw $20 16($3) # x final
	lw $21 20($3) # y final
	lw $28 24($3) # direita
	lw $29 28($3) # esquerda
	
	# chamada de funcao para
	# carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# tempo da animacao
	addi $8, $0, 25000 # taxa de tempo de espera
	jal timer
pers1:	
	lw $22 0($2) # base  
	lw $23 4($2) # altura 
	lw $18 8($2) # x inicial
	lw $19 12($2) # y inicial
	lw $20 16($2) # x final
	lw $21 20($2) # y final
	lw $28 24($2) # direita
	lw $29 28($2) # esquerda
	
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo
	
	bge $18, $20 pers2
	addi $18, $18, 2 # variacao do movimento
	
	sw $22 0($2) # base  
	sw $23 4($2) # altura 
	sw $18 8($2) # x inicial
	sw $19 12($2) # y inicial
	sw $20 16($2) # x final
	sw $21 20($2) # y final
	sw $28 24($2) # direita
	sw $29 28($2) # esquerda
	
pers2:
	lw $22 0($3) # base  
	lw $23 4($3) # altura 
	lw $18 8($3) # x inicial
	lw $19 12($3) # y inicial
	lw $20 16($3) # x final
	lw $21 20($3) # y final
	lw $28 24($3) # direita
	lw $29 28($3) # esquerda
	
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo
	
	bge $18, $20 pers3
	addi $18, $18, 1 # variacao do movimento
	
	sw $22 0($3) # base  
	sw $23 4($3) # altura 
	sw $18 8($3) # x inicial
	sw $19 12($3) # y inicial
	sw $20 16($3) # x final
	sw $21 20($3) # y final
	sw $28 24($3) # direita
	sw $29 28($3) # esquerda

pers3:	
	j animacao

fimanimacao:

	
end:
	addi $2, $0, 10 # encerra o programa
	syscall
	
# funcao para carregar cenario na tela
# paramentros:
	# local a ler $24
	# local a escrever $8
	# contador $10
load:	
	lw $9, 0($24)
	sw $9, 0($8)
	addi $8, $8, 4
	addi $24, $24, 4
	addi $10, $10, 1
	bne $10, $26, load
	jr $31
	
# funcao para guardar cenario e personagem na memoria	
	# local a ser lido $8
	# local a ser armazenado $24
	# contador $10
store:
	lw $9, 0($8)
	sw $9, 0($24)
	addi $8, $8, -4
	addi $24, $24, -4
	addi $10, $10, -1
	bne $10, 0, store
	jr $31


# funcao para desenhar personagem na tela
# parametros da funcao:
	# endereco inicial: $8 
	# Largura do personagem: $9
	# altura do personagem: $10
	# Saber o x: $11
	# Saber o y: $12
personagem:  
	lui $15, 0x1001
	sll $11, $11, 2
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # quantidade de memoria em width
	mul $12, $12, $1 
	add $15, $15, $11
	add $15, $15, $12 # posicao inicial a ser desenhada
	add $13, $0, $9 # largura 
laco1:	beq $10, $0, fimlaco1
laco2:	beq $9, $0, fimlaco2
	lw $14, 0($8) # local a ler
	sw $14, 0($15) # local a desenhar.
	addi $8, $8, 4 
	addi $15, $15, 4
	addi $9, $9, -1 # largura --
	j laco2
fimlaco2:   
	# addi $1 $0 width tela
	# div $1 proporcao width
	# sll $1 $1 2  
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # quantidade de memoria em width
	add $15, $15, $1
	sll $16, $13, 2 
	sub $15, $15, $16
	add $9, $0, $13 # largura valor inicial
	addi $10, $10, -1 # altura --  
	j laco1  
fimlaco1: 
	jr $31
            
# funcao para carregar parte do cenrio.
# parametros da funcao: 
	# Largura do personagem: $9
	# altura do personagem: $10
	# Saber o x: $11
	# Saber o y: $12
carregafundo:  
	lui $15, 0x1001
	sll $11, $11, 2
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # quantidade de memoria em width
	mul $12, $12, $1 
	add $15, $15, $11
	add $15, $15, $12 # posicao inicial a ser desenhada
	add $13, $0, $9 # largura        
